description:
&quot;Get inside a particle accelerator and experience unbelievable speed previously reserved for only the most advanced laboratories on Earth! The Collider is a fast-paced and compelling arcade game that will put your reflexes to the test. Tune in with the energizing electronic music and beat your friends' high scores.&quot;

If you like games like Super Hexagon, Velocibox and Boson X, this game is for you. Only this one is played with a mouse.

